import React, { Component } from 'react';
import './Die.css';

const fontAwesome_API = "fas fa-dice-";

class Die extends Component {


    render(props) {

        const dieNum = fontAwesome_API + this.props.num;

        return (
            <span className="Die-icon"> 
                <i class={dieNum}></i>
            </span>
        )
    }
}

export default Die;
